    return(
        <Container>
            <Row>
                <div style={{backgroundColor:'red', height:'200px'}}>?<br/></div><br/>
                <div style={{backgroundColor:'red', height:'200px'}}>?<br/></div>
                <Col>
                    <p> text text text</p>
                </Col>
            </Row>
        </Container>
    );
}

export default ExtraCur;
